import React from "react";
import Header from "./Header";
import Banner from "./Banner";
import About from "./About";
import Services from "./Services";
import ContactUs from "./Contactus";

function App() {
  return (
    <div>
      <Header />
      <Banner />
      <About />
      <Services />
      <ContactUs />
    </div>
  );
}

export default App;
